 function Gerar_pdf(){
  var doc = new jsPDF('l', 'mm');

  var dom = new Object();
  dom.title = document.querySelector('.box-dados-title');
  dom.tag = dom.title.getElementsByTagName('h1');
  dom.info_pdf = function(){
  	var rescrita = dom.tag[0].childNodes[0].nodeValue.replace("Relatório", "");
  	if(rescrita == true){
  		return rescrita;
  	}
  	dom.texto = 'Relatório: ' + rescrita;
  	dom.datatime = 'Gerado em: ' + new Date().toLocaleString();	
  	return dom.texto + '- ' + dom.datatime;
  }
  dom.construct_pdf = function() {
  	var dataUrl = 'data:image/jpeg;base64,';
	  doc.setFontSize(10);
	  doc.addImage(dataUrl,'JPG',14,2,50,26);
	  doc.text(dom.info_pdf(), 14, 40);
	  doc.autoTable({html: '#HTMLtoPDF', columnStyles: {0: {halign: 'center'}},styles: {fillColor:'#fff3a0'},startY:45,pageBreak:'auto',theme: 'striped'});
	  window.open(doc.output('bloburl'), '_blank');
  }
  dom.construct_pdf();
}